import { useContext } from 'react'
import './Navbar.css'

function notloggedelements() {
    return (
        <>
            <a className="navbar-element" href='/login'>Log in</a>
            <a className="navbar-element" href='/register'>Register</a>
        </>
    )
}


function loggedelements() {
    return (
        <>
            <a className="navbar-element" href='/login'>Profile</a>
        </>
    )
}

export default function Navbar(props) {

    const userType = useContext(UserTypeContext);


    return (
        <nav className="navbar-container">
            <div className="navbar-items"><a href="/">LOGO</a></div>
            <div className="navbar-items">
                <li>
                    <a className="navbar-element" href='/actividades'>Actividades</a>
                    <a className="navbar-element">Nosotros</a>
                    <a className="navbar-element">Contacto</a>
                    <a className="navbar-element"></a>
                </li>
            </div>
            <div className="navbar-items">
                {props.logged == true? notloggedelements : loggedelements}
            </div>
        </nav>
    )
}
